import React from 'react';
import "./index.css";
import {Route, Switch} from "react-router-dom";
import Home from './Home';
import About from './About';

const App = () => {
 
  return (
    <>
    <Switch>
      <Route exact path="/" component = {Home} />
      <Route exact path="/about" component = {About} />
    </Switch>
    </>
  )
}

export default App;
